import React from "react";
import { Container } from "react-bootstrap";
import header from "./components/header";
const App = () => {
  <header />;
  return (
    <>
      <main className="py-3">
        <Container>
          <h1>Welcome to my react-app</h1>;
        </Container>
      </main>
    </>
  );
};

export default App;
